import Popup from 'reactjs-popup'; 

export default function AddTaskForm(props) {

    return (

        <Popup trigger={props.trigger}>

            <form>
                <label for="task_input">Description:</label>
                <input type="text" id="task_input"></input>

                <br></br>

                <label for="date_input" hidden={props.date != null}>Due Date:</label>
                <input type="text" id="date_input" hidden={props.date != null}></input>

                <br></br>

                <label for="time_input" >Schedule:</label>
                <input type="text" id="time_input"></input>

                <input type="submit"></input>
            </form>

            <button onClick={getFormData}> Submit: </button>

        </Popup>

    ); 

    function getFormData(event) {

        console.log(event); 


        // Add prop function to send to parent
    }

}
